snippet.description:
Una domenica piena di NEWS. Come ogni domenica tranne la scorsa, perché eravamo con alcuni di voi in Giappone. Quanto ci siamo divertiti, è vero, però adesso si ritorna alla grande. Per intanto, BUONA DOMENICA con le NEWS DELLA SETTIMANAZZA:

INDICE DELLE #NEWS VIDEOGIOCHI:
0:00 - Il grande ritorno!
0:19 - Videogiocare dieci ore a settimana fa male alla salute: lo studio;
1:10 - Microsoft annuncia un nuovo Developer Direct;
1:33 - L'Italia (l'AGCM) si accorge adesso delle microtransazioni;
2:26 - Non è vero che Electronic Arts fa schifo;
3:11 - Le aspettative per The Elder Scrolls 6 e Falllout 5 sono troppo alte?
4:48 - Bethesda "non sa più fare Fallout e TES e dovrebbe venderli";
5:35 - Project Mara di Ninja Theory è stato cancellato?
6:13 - Bye Sweet Carole è il primo videogioco italiano candidato agli Annie Awards;
6:52 - Far Cry 3, Primal e Blood Dragon riceveranno un upgrade per PS5 e XSX/S, a quanto pare;
7:27 - Avowed annunciato, a prezzo budget, per PS5;
7:52 - Nintendo crolla in borsa, nuovo Switch 2 all'orizzonte e aumento di prezzi in vista?
8:42 - Ecco il protagonista della serie TV di God of War;
9:22 - PlayStation Plus Extra e Premium: le novità di gennaio 2026;
9:39 - NEWS A RAFFICA;
14:08 - Ecciao.

2026
- Raiden & Midna

